import React from "react";
import { useWaterBrands } from "../../custom-hooks";
import "./table.css";

const Table = () => {
  const columns = [
    "브랜드",
    "제조원",
    "수질적합여부",
    "부적합판정횟수",
    "출시일",
  ];
  const waterBrands = useWaterBrands();
  return (
    <div className="tableWrapper">
      <div className="tableTable">
        <thead>
          <tr>
            {columns.map((column) => (
              <th>{column}</th>
            ))}
          </tr>
        </thead>
        <tbody>

        </tbody>
      </div>
    </div>
  );
};

export default Table;
